import React from "react";
import BackgroundImage from "../../assets/images/BackgroundRegisterScreen.png";
import { Container, SubArea } from "./styles";
import DefaultInput from "../../components/DefaultInput";

const Register = () => {
  return (
    <Container>
      <SubArea width="710px" backgroundImage={BackgroundImage}></SubArea>
      <SubArea width="730px">
        <DefaultInput placeHolder="Nome Completo" />
        <DefaultInput placeHolder="Email" type="mail" />
        <DefaultInput placeHolder="senha" type="password" />
      </SubArea>
    </Container>
  );
};

export default Register;
